import React, {useState} from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
   
const App = () => {
  return (
    <React.Fragment>
     <h1> Jatin Thakur </h1>
     <div class="container">
  <div class="row">
    <div class="col-sm">
      One of three columns
    </div>
    <div class="col-sm">
      One of three columns
    </div>
    <div class="col-sm">
      One of three columns
    </div>
  </div>
</div>
    </React.Fragment>
  );
};

export default App;
